import React from "react";

function Footer() {
  return (

    <footer>
        <img className="SimpsonsLogo" src="assets/images/simpsonlogo.png" alt="logo" /> 
        <span id="footer-right">A Simpsons Memory Game DOH!</span> 
    </footer>
  );
}

export default Footer;
